void scalerVIP_Identify_Pattern_forMEMC_TV001(void)
{
	unsigned char i = 0,j = 0;
	unsigned int nIdentify_Pattern=0;

	// for all source
	//==============================================================================================//
	#if 1
	for(i = 0; i < 255; i++){
		DynamicOptimizeMEMC[0][i] = 0;
	}
	DynamicOptimizeMEMC_TV001();
	#endif
	//==============================================================================================//

	// for debug
	if((MA_print_count%debug_print_delay_time==0)&&(Start_Print.ID_Pattern_2==TRUE))
	{
		for(i=0;i<=(255/25);i++)
		{
			nIdentify_Pattern =0;
			for(j=1;j<=25;j++){
				if((i*25+j <255) && DynamicOptimizeMEMC[0][i*25+j] == 1){
					nIdentify_Pattern |= DynamicOptimizeMEMC[0][i*25+j]<<(j-1);
				}
			}
			if(nIdentify_Pattern>0){
				nIdentify_Pattern |= i<<25;
				rtd_pr_hist_info("[001]nIdentify_Pattern = %d \n",nIdentify_Pattern);
			}
		}
	}
}




